import collections
import time

def timer(func):
    '''统计函数运行时间的装饰器'''
    def wrapper(*args, **kwargs):
        start = time.time()
        ret_value = func(*args, **kwargs)
        end = time.time()
        used = end - start
        print(f'{func.__name__} used {used}')
        return ret_value
    return wrapper

#方法一 前缀树
class Trie:
    def __init__(self):
        # self.child = collections.defaultdict(dict) #等价self.child = {}
        self.child = {}
    
    def insert(self, word: str) -> None: #lc208题目答案
        nownode = self.child
        for s in word:
            if s not in nownode.keys():
                nownode[s] = {}  #创建下一个节点
            nownode = nownode[s]
        nownode['#']='#'         #有一定的局限性 前提是单词里不能有结束符


    def travel(self) -> list: #原题目
        nownode = self.child
        ret =[]
        str =''
        if not nownode:
            return ret
        def findkey(nownode, str):
            nonlocal ret
            for key in nownode:
                if '#' in nownode[key]: #如果当前字典的值的所有字典的关键字有结束符#，则输出
                    return ret.append(str+key)
                nodes = nownode[key]
                for node_s in nodes:
                    findkey({node_s:nodes[node_s]}, str+key)
        findkey(nownode, str)
        return ret

@timer
def common_path_trie(words):
    obj = Trie()
    for word in words:
        # print(word)
        word = word if word else "''"
        obj.insert(word)

    return obj.travel()

#方法二 排序 ＋ 滑动窗口
@timer
def common_path(words):
    ret = []
    n = len(words)
    if n<2:
        return words
    words.sort()
    left = words[0]
    for i in range(1,n):
        if left not in words[i]:
            ret.append(left)
            left = words[i]
    if left != ret[-1]:
        ret.append(left)
    return ret

